import React, { useState } from 'react';
import axios from 'axios';
import './styles/AddQuestionForm.css';
import { Link } from 'react-router-dom';


const AddQuestionForm = ({ onAddQuestion, quizId, history }) => {
  const [question, setQuestion] = useState('');
  const [options, setOptions] = useState(['', '', '', '']);
  const [answer, setAnswer] = useState('');
  const [difficulty, setDifficulty] = useState('');


  const handleOptionChange = (index, value) => {
    const newOptions = [...options];
    newOptions[index] = value;
    setOptions(newOptions);
  };

  return (
    <form className="add-form" onSubmit={handleSubmit}>
    <h1>Add Question </h1>
      <div className="form-control">
        <label>Question</label>
        <input
          type="text"
          placeholder="Enter question"
          value={question}
          onChange={(event) => setQuestion(event.target.value)}
        />


        <label>Option A</label>
        <input
          type="text"
          placeholder="Enter option A"
          value={options[0]}
          onChange={(event) => handleOptionChange(0, event.target.value)}
        />


        <label>Option B</label>
        <input
          type="text"
          placeholder="Enter option B"
          value={options[1]}
          onChange={(event) => handleOptionChange(1, event.target.value)}
        />


        <label>Option C</label>
        <input
          type="text"
          placeholder="Enter option C"
          value={options[2]}
          onChange={(event) => handleOptionChange(2, event.target.value)}
        />


        <label>Option D</label>
        <input
          type="text"
          placeholder="Enter option D"
          value={options[3]}
          onChange={(event) => handleOptionChange(3, event.target.value)}
        />

  <label>Answer</label>
  <div className="radio">
    <label>
      <input
        type="radio"
        name="answer"
        value="A"
        checked={answer === "A"}
        onChange={(event) => setAnswer(event.target.value)}
      />
      A
    </label>
    <label>
      <input
        type="radio"
        name="answer"
        value="B"
        checked={answer === "B"}
        onChange={(event) => setAnswer(event.target.value)}
      />
      B
    </label>
    <label>
      <input
        type="radio"
        name="answer"
        value="C"
        checked={answer === "C"}
        onChange={(event) => setAnswer(event.target.value)}
      />
      C
    </label>
    <label>
      <input
        type="radio"
        name="answer"
        value="D"
        checked={answer === "D"}
        onChange={(event) => setAnswer(event.target.value)}
      />
      D
    </label>
  </div>


  <label>Difficulty</label>
  <div className="radio">
    <label>
      <input
        type="radio"
        name="difficulty"
        value="easy"
        checked={difficulty === "easy"}
        onChange={(event) => setDifficulty(event.target.value)}
      />
      Easy
    </label>
    <label>
      <input
        type="radio"
        name="difficulty"
        value="medium"
        checked={difficulty === "medium"}
        onChange={(event) => setDifficulty(event.target.value)}
      />
      Medium
    </label>
    <label>
      <input
        type="radio"
        name="difficulty"
        value="hard"
        checked={difficulty === "hard"}
        onChange={(event) => setDifficulty(event.target.value)}
      />
      Hard
    </label>
  </div>

</div>
	<div className="nav-button">
	    <Link to="/editquiz"><button>Submit</button></Link>
	    <Link to="/editquiz"><button>Cancel</button></Link>
	</div>



</form>
);
};

export default AddQuestionForm;
